import React from 'react';
import '../css/Home.css';

import { useNavigate } from 'react-router-dom'; 

import aiImage from '../img/2.jpeg';
import mlImage from '../img/1.jpeg';
import dsImage from '../img/3.jpeg';

function Home() {
    const navigate = useNavigate();

    const goToAiMlPage = () => {
        navigate('/aiml');
    }

    const goToDsPage = () => {
        navigate('/Ds');
    }
    return (
        <div className="home-container">
        <div className="introduction">
            <h1>Welcome to AI/ML HUB</h1>
            <p>Your journey into the world of Artificial Intelligence, Machine Learning, and Data Science starts here.</p>
        </div>
        <div className="sections-container">
            <div className="section">
                <img src={aiImage} alt="Artificial Intelligence" />
                <h2>AI & ML</h2>
                <p>Artificial Intelligence (AI) and Machine Learning (ML) represent the cutting-edge of technology, focusing on creating systems that can learn, adapt, and make decisions...</p>
                <button onClick={goToAiMlPage}>Learn AI</button>
            </div>

            <div className="section">
                <img src={mlImage} alt="Machine Learning" />
                <h2>Data Science</h2>
                <p>Brief description of Data Science...</p>
                <button onClick={goToDsPage}>Learn Data Science</button>
            </div>

            <div className="section">
                <img src={dsImage} alt="Data Science" />
                <h2>Reinforcement Learning</h2>
                <p>Brief description of Reinforcement Learning...</p>
                <button onClick={goToRlPage}>Learn Reinforcement Learning</button>
            </div>
        </div>
    </div>
    );
}

export default Home;
